import React from 'react';
import './App.css';
import CreatureCard from './Components/CreatureCard'
import creatures from './CreaturesJSON/CreaturesJSON';

const creatureList = [...creatures];


function App() {




  return (
    <div className="App">



      <div className="card-container">
        {creatureList.map(creature => (
          <CreatureCard
            name={creature.name}
            type={creature.type}
            location={creature.location}
            price={fishy.price}
          />
        ))}
      </div>
    </div>
  );
}


export default App;
